import { configureStore } from '@reduxjs/toolkit';
import { navigationReducer, changePath, LOGIN_PATH } from './slices/navigationSlice';
import { loginReducer, changeLoginInput } from './slices/loginSlice';

const store = configureStore(
{
    reducer: 
    {
        navigation: navigationReducer,
        login: loginReducer
    }
});

export { LOGIN_PATH, changePath, changeLoginInput, store };
